import { CCol, CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import CButton from "src/Components/UI/Button/Button";
import Card from "src/Components/UI/Card/Card";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
const PasswordReset = (props) => {
  const data = props.body;
  console.log(data);
  return (
    <Card color="primary" header="Change Password">
      <Form>
      <CRow>
          <FormInputLabel
            label="New Password"
            type="password"
            readOnly={false}
            md={9}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="New Password"
            type="password"
            readOnly={false}
            md={9}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="Confirm Password"
            type="text"
            readOnly={false}
            md={9}
            sm={12}
          />
        </CRow>
        <CRow>
          <CCol md={12} sm={12} className="text-right">
            <CButton
              color="success"
              width="30%"
              type="submit"
              loading={false}
              name="update"
            />
          </CCol>
        </CRow>
      </Form>
    </Card>
  );
};

export default PasswordReset;
